import React from 'react'

class Navigation extends React.Component
{
render()
{
    return(
        <div>
            <nav className="nav">
                <ul>
                <li className ="nav-item">
                    <a className ="nav-item" href ="#">MENU</a> </li>
                <li >GENRE </li>
                <li>DATE </li>
                    </ul>
            </nav>
        </div>
    )
}
}
export default Navigation
